import React from 'react';
import questions from '../data/questions';

function Answer({id, setId}){
	function neeHandler(){
		setId(questions[id][1]);
	}
	function jaHandler(){
		setId(questions[id][2]);
	}
	return(
		<div className="card-footer">
			{console.log("answer: ", id)}
			<div className="btn-group">
				<a type="button" className="fa" onClick={jaHandler}> JA </a>
				<a type="button" className="fa NW"> WEET IK NIET </a>
				<a type="button" className="fa" onClick={neeHandler}>NEE </a>
			</div>
		</div>
	);
}
export default Answer;
